import React from 'react';
import PropTypes from 'prop-types';

const TabletLayout = ({children, SideMenu, Side}) => {
    
    return(
        <div id="tabletWrapper" style={{display:"flex", width:"90%", margin:"0 auto"}}>
            <div style={{display:"flex", flexFlow:"row wrap", width:"10%", alignContent: "flex-start"}}>
            {SideMenu}
            </div>
            <div style={{width:"80%"}}>
            {children}
            </div>
        </div>
    );
};

TabletLayout.propTypes = {
    children: PropTypes.node.isRequired,
};

export default TabletLayout;
